// =====================================
// BULLETPROOF ANRUFER-SUCHE
// =====================================

const allRows = $input.all();
const searchNumber = $('Webhook').item.json.body.fromNumber;

console.log('=== START SUCHE ===');
console.log('Webhook-Nummer:', searchNumber);
console.log('Anzahl Zeilen:', allRows.length);

// Normalisierung: Entferne ALLES außer Ziffern
function normalizePhone(number) {
  if (!number) return '';
  // Konvertiere zu String und behalte NUR Ziffern
  return String(number).replace(/\D/g, '');
}

const normalizedSearch = normalizePhone(searchNumber);

console.log('Normalisiert gesucht:', normalizedSearch);
console.log('Länge:', normalizedSearch.length);

// Durchsuche ALLE Zeilen
let foundRow = null;
let matchIndex = -1;

for (let i = 0; i < allRows.length; i++) {
  const row = allRows[i];
  const rowNumber = normalizePhone(row.json.Telefonnummer);

  console.log(`\n--- Zeile ${i} ---`);
  console.log('Original:', row.json.Telefonnummer);
  console.log('Normalisiert:', rowNumber);
  console.log('Länge:', rowNumber.length);

  // Mehrere Vergleichsmethoden
  const directMatch = (rowNumber === normalizedSearch);
  const trimmedMatch = (rowNumber.trim() === normalizedSearch.trim());
  const includesMatch = rowNumber.includes(normalizedSearch) || normalizedSearch.includes(rowNumber);

  console.log('Direct Match?', directMatch);
  console.log('Trimmed Match?', trimmedMatch);
  console.log('Includes?', includesMatch);

  if (directMatch || trimmedMatch) {
    foundRow = row;
    matchIndex = i;
    console.log('✅ MATCH GEFUNDEN bei Index', i);
    break;
  }
}

console.log('\n=== ENDE SUCHE ===');
console.log('Match gefunden?', !!foundRow);

// Ergebnis
if (foundRow) {
  return {
    json: {
      gefunden: true,
      vorname: foundRow.json.Vorname,
      name: foundRow.json.Name,
      telefonnummer: foundRow.json.Telefonnummer,
      anredeform: foundRow.json.Anredeform,
      anrede: foundRow.json.Anrede,
      rowIndex: matchIndex
    }
  };
} else {
  // FALLBACK: Manuelle Suche mit find()
  console.log('\n=== FALLBACK-SUCHE ===');

  const manualMatch = allRows.find(row => {
    const n1 = normalizePhone(row.json.Telefonnummer);
    const n2 = normalizedSearch;
    return n1 === n2;
  });

  if (manualMatch) {
    console.log('✅ Fallback Match gefunden!');
    return {
      json: {
        gefunden: true,
        vorname: manualMatch.json.Vorname,
        name: manualMatch.json.Name,
        telefonnummer: manualMatch.json.Telefonnummer,
        anredeform: manualMatch.json.Anredeform,
        anrede: manualMatch.json.Anrede,
        method: 'fallback'
      }
    };
  }

  return {
    json: {
      gefunden: false,
      gesuchtNach: searchNumber,
      normalisiert: normalizedSearch,
      hinweis: 'Kein Match trotz identischer Nummern - möglicherweise Encoding-Problem'
    }
  };
}

const d = $input.first().json;
const h = new Date().getHours();
const g = h >= 5 && h < 12 ? 'Guten Morgen' : h >= 12 && h < 18 ? 'Guten Tag' : 'Guten Abend';

let b, anredeform, vorname, name;

// Prüfe ob Anrufer gefunden wurde
if (d.gefunden) {
  // BEKANNTER ANRUFER
  b = d.anredeform.toLowerCase() === 'du' 
    ? `${g} ${d.vorname}` 
    : `${g} ${d.anrede} ${d.name}`;

  anredeform = d.anredeform;
  vorname = d.vorname;
  name = d.name;

} else {
  // UNBEKANNTER ANRUFER
  const telefon = d.gesuchtNach || d.telefonnummer || '';
  const normalisiert = telefon.replace(/\D/g, '');

  const istGoehrum = normalisiert.includes('70317377');

  b = istGoehrum 
    ? 'Göhrum Fahrzeugteile, Kunkel'
    : 'Willkommen bei Berent Beratung plus Entwicklung';

  // Platzhalter für unbekannte Anrufer
  anredeform = 'Sie';
  vorname = 'Unbekannt';
  name = 'Unbekannt';
}

return { 
  json: { 
    begruessung: b,
    anredeform: anredeform,
    vorname: vorname,
    name: name
  } 
};

